import React from "react"

export default function Greetings(){
    return(
        <div className="greetings">
            <bold><h2>Welkome to our Solar Sistem</h2></bold>
            <p>Prepare for a lackluster tour through our humdrum solar system, where planets twirl in 
            a celestial ballet of monotony. From the scorching yawns of Mercury to the melancholy musings 
            of Neptune, it's a cosmic comedy of boredom.
            </p>
        </div>
    )
}
